import React from 'react';
import {
    Link,

} from 'react-router-dom';

export default function Topic (){
    return (
        <div>
            <h3>Topics</h3>
            <ul>
                <li>
                    <Link to='/topics/'>Rendering with React</Link>
                </li>
                <li>
                    <Link to=''>Components</Link>
                </li>
                <li>
                    <Link to=''>Props vs State</Link>
                </li>
            </ul>

        </div>
    )
}
